stdlib.min = function(){return 'Math.min('+arguments.join(',')+')'};
stdlib.mid = function(a,b,c){
	if(arguments.length == 2) return '('+a+').substr('+b+'-1)';
	else if(arguments.length == 3) return '('+a+').substr('+b+'-1,'+c+')';
};

